import React from 'react';
import { Typography, Container } from '@mui/material';

const Footer = () => (
  <footer>
    <Container>
      <Typography variant="body2" color="textSecondary" align="center">
        {'© '}
        {new Date().getFullYear()}
        {' My Portfolio. All rights reserved.'}
      </Typography>
    </Container>
  </footer>
);

export default Footer;
